import React from 'react';
import Information from '../components/Information'
import Content from '../components/Content'
import workExamples from "../workExamples"
import Rugby from "../Rugby"
import AFL from "../AFL"
import CK from "../CK"
import Ty from "../Ty"
import OGI from "../OGI"


const Home = (props) => {
    return (
        <div>
        {workExamples.map((props) => (
            <Information 
                title = {props[1].title}
                position={props[1].position}
                description={props[1].description}
                platform1={props[1].platform1}
                platform2={props[1].platform2}
                platform3={props[1].platform3}
                platform4={props[1].platform4}
                platform5={props[1].platform5}
            />
        ))}

            <dl className="dictionary">
            {workExamples.map((props) => (
                <Content
                    key={props.id}
                    title={props.title}
                    position={props.position}
                    description={props.description}
                />
                ))}
            </dl>
        </div>
    )
}

export default Home;
